import React from 'react';
import Card from './Card';

const CardList = ({ robots }) => {
	return (
		<div> 
      		<Card id={robots[0].id} name={robots[0].name} username={robots[0].username}/>
      		<Card id={robots[1].id} name={robots[1].name} username={robots[1].username}/>
      		<Card id={robots[2].id} name={robots[2].name} username={robots[2].username}/>
    	</div>
	);
}

export default CardList;
